export const Headers = () => {
  return (
    <div class={"table-headers"}>
      <caption class={"table-caption"}> Таблица размеров обуви</caption>
      <tr class={"table - caption - cell"}>
        <th class={"table-headers-cell"}>Россия</th>
        <th class={"table-headers-cell"}>Великобритания</th>
        <th class={"table-headers-cell"}>Европа</th>
        <th class={"table-headers-cell"}>Длина ступни, см</th>
      </tr>
    </div>
  );
};
